  assemblies:
  - NDSH.Geospatial.Metadata.ISO19115.Ed2003
  namespace: NDSH.Geospatial.Common.BasicTypes.Implementation.Names
  summary: Represents an unqualified, context-dependent name as defined in ISO 19115.
  remarks: >-
    A <xref href="NDSH.Geospatial.Common.BasicTypes.Implementation.Names.LocalName" data-throw-if-not-resolved="false"></xref> is a simple identifier that does not include any explicit namespace.

    It is used within metadata structures where the namespace is inferred from the surrounding context.

    <br />

    Therefore the <xref href="NDSH.Geospatial.Common.BasicTypes.Implementation.Names.LocalName.CodeSpace" data-throw-if-not-resolved="false"></xref> value of a <xref href="NDSH.Geospatial.Common.BasicTypes.Implementation.Names.LocalName" data-throw-if-not-resolved="false"></xref> is always <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/keywords/null">null</a>.

    <br />

    This class aligns with the ISO 19103 conceptual schema, where <xref href="NDSH.Geospatial.Common.BasicTypes.Implementation.Names.LocalName" data-throw-if-not-resolved="false"></xref> forms the base

    of structured naming within geographic metadata.
  example: []
  syntax:
