      [JsonObject("LocalName")]

      public class LocalName : GenericName, IModel, IObservableModel, INotifyPropertyChanged, IDbId, INullableCodeSpace, INullableRefValue<string>, IComparable<CodeType>, IEquatable<CodeType>, IComparable<LocalName>, IEquatable<LocalName>
    content.vb: >-
